import "./App.css";

function App() {
  return (
    <div className="App">
      <div className="information">
        <label>Date</label>
        <input type="text" />
        <label>Food Name</label>
        <input type="text" />
        <label>Serving Size</label>
        <input type="number" />
      </div>
    </div>
  );
}

export default App;
